import React, {Component} from 'react';
import Game from "./components/Game";
import Toe from "./components/Toe";

function f(e: any): void {
    console.log(e);
}

class App extends Component {
    render() {
        return (
            <div
                style={{
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    width: '100%',
                    height: '100%',
                    top: '0',
                    left: '0',
                    position: 'fixed'

                }}
            >

                <Game
                    child={<Toe/>}
                    onClick={() => {
                        console.log('hi')
                    }} onMouseEnterFunc={() => {
                    f(this)
                }}/>
            </div>
        );
    }
}

export default App;
